import React, { useState } from 'react';

const generations = [
  { value: '', label: 'Todas' },
  { value: '1', label: 'Generación 1' },
  { value: '2', label: 'Generación 2' },
  { value: '3', label: 'Generación 3' },
  { value: '4', label: 'Generación 4' },
  { value: '5', label: 'Generación 5' },
  { value: '6', label: 'Generación 6' },
  { value: '7', label: 'Generación 7' },
  { value: '8', label: 'Generación 8' },
  { value: '9', label: 'Generación 9' },
];

const types = [
  '', 'normal', 'fire', 'water', 'electric', 'grass', 'ice', 'fighting', 'poison',
  'ground', 'flying', 'psychic', 'bug', 'rock', 'ghost', 'dragon', 'dark', 'steel', 'fairy'
];

// Simulación de datos de Pokémon para ejemplo
const mockPokemons = [
  { number: 25, name: 'Pikachu', type: ['electric'], generation: '1' },
  { number: 1, name: 'Bulbasaur', type: ['grass', 'poison'], generation: '1' },
  { number: 4, name: 'Charmander', type: ['fire'], generation: '1' },
  { number: 7, name: 'Squirtle', type: ['water'], generation: '1' },
  { number: 133, name: 'Eevee', type: ['normal'], generation: '1' },
  // ...agrega más si quieres
];

const Search = () => {
  const [criteria, setCriteria] = useState({
    number: '',
    name: '',
    type: '',
    generation: ''
  });
  const [results, setResults] = useState([]);

  const handleChange = e => {
    setCriteria({ ...criteria, [e.target.name]: e.target.value });
  };

  const handleSubmit = e => {
    e.preventDefault();
    // Filtrado simple sobre mockPokemons
    let filtered = mockPokemons.filter(p => {
      const matchesNumber = criteria.number ? String(p.number) === String(criteria.number) : true;
      const matchesName = criteria.name ? p.name.toLowerCase().includes(criteria.name.toLowerCase()) : true;
      const matchesType = criteria.type ? p.type.includes(criteria.type) : true;
      const matchesGen = criteria.generation ? p.generation === criteria.generation : true;
      return matchesNumber && matchesName && matchesType && matchesGen;
    });
    setResults(filtered);
  };

  return (
    <div className="search">
      <h1>Buscar Pokémon</h1>
      <form onSubmit={handleSubmit} style={{ maxWidth: 400, margin: '0 auto', textAlign: 'left' }}>
        <label>
          Número de Pokédex:
          <input
            type="number"
            name="number"
            value={criteria.number}
            onChange={handleChange}
            min="1"
            placeholder="Ej: 25"
          />
        </label>
        <br />
        <label>
          Nombre:
          <input
            type="text"
            name="name"
            value={criteria.name}
            onChange={handleChange}
            placeholder="Ej: Pikachu"
          />
        </label>
        <br />
        <label>
          Tipo:
          <select name="type" value={criteria.type} onChange={handleChange}>
            {types.map(type => (
              <option key={type} value={type}>{type ? type.charAt(0).toUpperCase() + type.slice(1) : 'Todos'}</option>
            ))}
          </select>
        </label>
        <br />
        <label>
          Generación:
          <select name="generation" value={criteria.generation} onChange={handleChange}>
            {generations.map(gen => (
              <option key={gen.value} value={gen.value}>{gen.label}</option>
            ))}
          </select>
        </label>
        <br />
        <button type="submit">Buscar</button>
      </form>

      <div style={{ marginTop: 32 }}>
        {results.length > 0 ? (
          <div>
            <h2>Resultados:</h2>
            <ul>
              {results.map(p => (
                <li key={p.number}>
                  #{p.number} - {p.name} ({p.type.join(', ')}) - Gen {p.generation}
                </li>
              ))}
            </ul>
          </div>
        ) : (
          <p style={{ marginTop: 16 }}>No se encontraron resultados.</p>
        )}
      </div>
    </div>
  );
};

export default Search;
